import React from 'react';

// Images
import Music1 from '../Images/Music1.jpg';
import Music2 from '../Images/Music2.jpeg';

// COMPONENTS
import { Parallax, ParallaxLayer } from 'react-spring/renderprops-addons';

// CSS
import '../css/Interests.css'

export default class MusicParallax extends React.Component {

    render() {
        return (

            <ParallaxLayer
                speed ={.5}
                offset={1}>

                <div className='Music Interest'>

                    <Parallax
                        className='MusicParallax'
                        ref={ref => (this.MusicParallax = ref)}
                        pages={1.5}
                        style={{ 'height': '90vh', 'width': '100%' }}>

                        <div className='Pictures'>

                            <ParallaxLayer
                                speed={-1}
                                offset={0}>

                                <div className='Info'>
                                    <img src={Music2} onClick={() => this.MusicParallax.scrollTo(0)} className='Image' />
                                    <p>Photography is one of my favorite ways to feel free. I love taking pictures of the city.</p>
                                </div>

                                <div className='Back'>
                                    <button >⬆︎</button>
                                </div>

                            </ParallaxLayer>

                            <ParallaxLayer
                                speed={1}
                                offset={0}>

                                <div className='Cover'>
                                    <img src={Music1} className='Image' />
                                </div>

                            </ParallaxLayer>

                            <ParallaxLayer
                                speed={1}
                                offset={0.03}>

                                <div className='Topic'>
                                    <h1>Music</h1>
                                    <button onClick={() => this.MusicParallax.scrollTo(1.5)}>⬇︎</button>
                                </div>

                            </ParallaxLayer>

                        </div>

                    </Parallax>

                </div>

            </ParallaxLayer>

        )
    }

}
